rray Options \"<Sheetname>\" and <RowNumber> page\n    When the user clicks the Run button in try editor page\n    Then the user should see an error message\n\n    Examples: \n      | Sheetname | RowNumber |\n      | Array     |         1 |\n      | Array     |         2 |\n      | Array     |         3 |\n      | Array     |         4 |\n\n  @Regression\n  Scenario Outline: Verify that user is able to run valid and invalid Python code in Try Editor for ArrayPage\n    Given the user is on the tryeditor page of Array in python\n    When The user enters code \"<code>\", \"<Sheetname>\" and <RowNumber> from tryeditor and clicks the Run button\n    Then The user should see an result \"<expectedresult>\", \"<Sheetname>\" and <RowNumber>\n\n    Examples: \n      | Sheetname | RowNumber | code    | expectedresult     |\n      | tryEditor |         1 | Valid   | successouput       |\n      | tryEditor |         2 | Invalid | alertmessageoutput |\n\n   @Regression\n  Scenario Outline: Verify that user is able to run valid Python code in Try Editor for Array page\n    Given The user is on the tryeditor page of Array Using List\n    When The user enters code \"<code>\", \"<Sheetname>\" and <RowNumber> clicks the Run button\n    Then The user should see an result \"<expectedresult>\", \"<Sheetname>\" and <RowNumber>\n\n    Examples: \n      | Sheetname | RowNumber | code    | expectedresult     |\n      | tryEditor |         1 | Valid   | successouput       |\n      | tryEditor |         2 | Invalid | alertmessageoutput |\n\n   @Regression\n  Scenario Outline: Verify that user is able to run valid Python code in Try Editor for Array Page\n    Given The user is on the tryeditor page of Basic Operation in List\n    When The user enters code \"<code>\", \"<Sheetname>\" and <RowNumber> clicks the Run button\n    Then The user should see an result \"<expectedresult>\", \"<Sheetname>\" and <RowNumber>\n\n    Examples: \n      | Sheetname | RowNumber | code    | expectedresult     |\n n the user clicks on the options under \"<Sheetname>\" and <RowNumber> dataStructure after signin\r\n    Then The user should be navigated to the options page after sign \"<Sheetname>\" and <RowNumber>\r\n\r\n    Examples:\r\n      | Sheetname     |RowNumber  |\r\n      | Home2         |   1       |\r\n      | Home2         |   2       |\r\n      | Home2         |   3       |\r\n      | Home2         |   4       |\r\n      | Home2         |   5       |\r\n      | Home2         |   6       |","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/SahanaNUMPYNINJASDET\/gitsss\/DsAlgoQuesters\/src\/test\/resources\/dsAlgoFeatures\/Graph.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Graph functionality","description":"","children":[{"background":{"location":{"line":3,"column":1},"keyword":"Background","name":"","description":"","steps":[{"location":{"line":4,"column":1},"keyword":"Given ","keywordType":"Context","text":"The user is on the DSAlgo homepage after sign","id":"671fb9c3-7d9b-45dd-8684-b8d46f8c7646"}],"id":"6b26007f-0949-4475-9c02-56173b4179bf"}},{"scenario":{"location":{"line":7,"column":1},"tags":[{"location":{"line":6,"column":1},"name":"@graph1","id":"9f45ecd4-9e8f-46cc-a4f5-90b643c00c01"}],"keyword":"Scenario","name":"Verify that the user can navigate to the Graph page after signin","description":"","steps":[{"location":{"line":9,"column":5},"keyword":"When ","keywordType":"Action","text":"the user clicks on the GetStarted button of Graph section","id":"ec1ce3fe-5ea0-4c57-8322-c54bfa19e7d8"},{"location":{"line":10,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"the user is navigated to the Graph page","id":"0d6ef6c9-518c-4121-a3b5-548a6c2565c7"}],"examples":[],"id":"13c1a8db-1656-48d6-9d1a-4724d832f234"}},{"scenario":{"location":{"line":13,"column":1},"tags":[{"location":{"line":12,"column":1},"name":"@graph2","id":"ee561b24-706a-449e-9d88-026bee87  to land on DsAlgo portal \r\n\r\n@Home2\r\nScenario: verify that user is able to navigate to homepage when clicked on getstarted button\r\n    Given the user navigates to the DsAlgo portal\r\n    When The user click on Getstarted button\r\n    Then the user navigates to DSAlgo home page\r\n\r\n@Home3\r\nScenario: Verify that the user is able to Navigate to Register page\r\n    Given the user is on the DSAlgo homepage\r\n    When The user clicks on the Register button\r\n    Then the user should be navigated to the Register page\r\n\r\n@Home4\r\nScenario: Verify that the user is able to Navigate to Login page\r\n    Given the user is on the DSAlgo homepage\r\n    When  The user clicks on the signin button\r\n    Then the user should be navigated to the signin page \r\n \r\n@Home5   \r\nScenario Outline: Verify that the user sees six options under the Data Structure dropdown before logging in\r\n    Given the user is on the DSAlgo homepage\r\n    When the user clicks on the Data Structure button\r\n    Then the user should see six options: \"<option1>\",\"<option2>\",\"<option3>\",\"<option4>\",\"<option5>\", and \"<option6>\" under the Data Structure dropdown\r\n    Examples:\r\n    | option1 | option2 | option3 | option4 | option5 | option6 |\r\n    | Arrays | Linked List | Stack | Queue | Tree | Graph |\r\n\r\n@Home6    \r\nScenario Outline: Verify the error message when the user clicks on the GetStarted button under all the options in Home Page without signing in\r\n    Given the user is on the DSAlgo homepage\r\n    When the user clicks on the GetStarted button under \"<Section>\"\r\n    Then the user should see an error message stating \"You are not logged in\"\r\n  \r\n  Examples:\r\n  | Section                     |\r\n  | Data Structures-Introduction|\r\n  | Array                       |\r\n  | Linked List                 |\r\n  | Stack                       |\r\n  | Queue                       |\r\n  | Tree                        |\r\n  | Graph ser clicks Implementation using collections deque button\n    Then The user should be redirected to Implementation using collections deque page\n\n  @Queue05\n  Scenario: Verify that user is able to navigate to \"try Editor\" page for \"Implementation using collections.deque\" page\n    Given The user is on the Implementation using collections deque page\n    When The user clicks Try Here button in Implementation using collections deque page\n    Then User should be redirected to a page having an try Editor with a Run button to test\n\n  @Queue06\n  Scenario: Verify that user is able to navigate to \"Implementation using array\" page\n    Given The user is in the Implementation using collections deque page\n    When The user clicks Implementation using array button\n    Then The user should be redirected to Implementation using array page\n\n  @Queue07\n  Scenario: Verify that user is able to navigate to \"try Editor\" page for \"Implementation using array\" page\n    Given The user is on the Implementation using array page\n    When The user clicks Try Here button in Implementation using array page\n    Then User should be redirected to a page having an try Editor with a Run button to test\n\n  @Queue08\n  Scenario: Verify that user is able to navigate to \"Queue Operations\" page\n    Given The user is in the Implementation using array page\n    When User clicks Queue Operations button\n    Then User should be redirected to Queue Operations page\n\n  @Queue09\n  Scenario: Verify that user is able to navigate to \"try Editor\" page for \"Queue Operations\" page\n    Given User is on the Queue Operations page\n    When The user clicks Try here button in Queue Operations page\n    Then User should be redirected to a page having an try Editor with a Run button to test\n\n  @Regression\n  Scenario Outline: Verify that valid and invalid python code in TryEditor Implementation of Queue in Python\n    Given The user is in TryEditor page of Implementation of Queue in Pytho <RowNumber>\n\n    Examples: \n      | Sheetname | RowNumber | code    | expectedresult     |\n      | tryEditor |         1 | Valid   | successouput       |\n      | tryEditor |         2 | Invalid | alertmessageoutput |\n\n  @Queue15\n  Scenario: Verify that user receives error when user clicks on run button without entering code in tryeditor for Implementation of Queue in Python\n    Given The user is on the tryeditor page of Implementation of Queue in Python\n    When the user clicks the Run button of Implementation of Queue in Python\n    Then the user should see an error message\n\n  @Queue16\n  Scenario Outline: Verify the user is able to navigate to the pratice questions on each Queue topics\n    Given The user navigates to options \"<SheetName>\" and <RowNumber> of Queue page\n    When User click Practice Questions Link\n    Then User should navigate to Practice questions from \"<SheetName>\" and <RowNumber> Queue Topics\n\n    Examples: \n      | SheetName | RowNumber |\n      | Queue     |         1 |\n      | Queue     |         2 |\n      | Queue     |         3 |\n      | Queue     |         4 |\n\n  @Queue17\n  Scenario Outline: Verify the user see list of Practice Questions in Practice Questions Page of Queue Options\n    Given The user navigates to Queue Options \"<Sheetname>\" and <RowNumber> of queue page\n    When The user clicks on the Practice Questions link\n    Then The user should see list of Practice Questions in Practice Questions Page\n\n    Examples: \n      | SheetName | RowNumber |\n      | Queue     |         1 |\n      | Queue     |         2 |\n      | Queue     |         3 |\n      | Queue     |         4 |\n","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/SahanaNUMPYNINJASDET\/gitsss\/DsAlgoQuesters\/src\/test\/resources\/dsAlgoFeatures\/Queue.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Queue functionality","description":"","ch ge \"Please fill out this field\" is displayed in Password Confirmation textbox\r\n\r\n    Examples: \r\n      | Sheetname | RowNumber |\r\n      | Register  |         1 |\r\n\r\n  @Register3\r\n  Scenario Outline: : Verify that user gets error message giving username and password without entering password confirmation when\r\n    clicking on register button\r\n\r\n    Given The user is on the register page\r\n    When The user enters the username and password and clicks Register button \"<Sheetname>\" and <RowNumber>\r\n    Then The user should get error message \" Please fill out this field\" is displayed in Password Confirmation textbox\r\n\r\n    Examples: \r\n      | Sheetname | RowNumber |\r\n      | Register  |         2 |\r\n\r\n  @Register4\r\n  Scenario Outline: Verify that user gets error message without entering username , password and password confirmation when clicking on\r\n    register button\r\n\r\n    Given The user is on the register page\r\n    When The user clicks Register button on the Register page without entering username ,password and password confirmation \"<Sheetname>\"and <RowNumber>\r\n    Then The user should get error message \" Please fill out this field\" is displayed in Password Confirmation textbox\r\n\r\n    Examples: \r\n      | Sheetname | RowNumber |\r\n      | Register  |         3 |\r\n\r\n  @Register5\r\n  Scenario Outline: Verify that user gets error message giving username and entering password and password confirmation different when\r\n    clicking on register button\r\n\r\n    Given The user is on the register page\r\n    When The user enters the username and password different and clicks Register button from sheet \"<Sheetname>\" and row <RowNumber>\r\n    Then The user should get error message \"password_mismatch:The two password fields didnt match.\" in register page\r\n\r\n    Examples: \r\n      | Sheetname | RowNumber |\r\n      | Register  |         4 |\r\n\r\n  @Register6\r\n  Scenario Outline: Verify that user gets error mesage when entering only numeric when clicking on register button\r\n    Given The user is on the register page\r\n    When The user enters the Password only numeric and clicks Register button from sheet \"<Sheetname>\" and row <RowNumber>\r\n    Then The user should get error message \"password_mismatch:The two password fields didnt match.\" in register page\r\n\r\n    Examples: \r\n      | Sheetname | RowNumber |\r\n      | Register  |         5 |\r\n\r\n  @Register7\r\n  Scenario Outline: Verify that user gets error message giving invalid username like %,$,& (Example: Tom$, Tom%) when clicking on register\r\n    button\r\n\r\n    Given The user is on the register page\r\n    When The user enters the invalid username like %,$,& and clicks Register button from sheet \"<Sheetname>\" and row <RowNumber>\r\n    Then The user should get error message \"password_mismatch:The two password fields didnt match.\" in register page\r\n\r\n    Examples: \r\n      | Sheetname | RowNumber |\r\n      | Register  |         6 |\r\n\r\n  @Register8\r\n  Scenario Outline: Verify that user gets error message while entering the password less than 8 characters when clicking on register button\r\n    Given The user is on the register page\r\n    When The user enters the password less than eight characters and clicks Register button from sheet \"<Sheetname>\" and row <RowNumber>\r\n    Then The user should get error message \"password_mismatch:The two password fields didnt match.\" in register page\r\n\r\n    Examples: \r\n      | Sheetname | RowNumber |\r\n      | Register  |         7 |\r\n\r\n  @Register9\r\n  Scenario: Verify that user is able to see Register and sign in linkswhen clicking on signout link\r\n    Given The User is On The Home Page\r\n    When The user clicks Signout link\r\n    Then The user should be able to see Register and sign in links at the top corner of the home page\r\n\r\n  @Register10\r\n  Scenario: Verify that user is able to login to DSAlgo after doing successful registration\r\n    Given The User is On The Home Page\r\n    When The user clicks login button\r\n    Then The user should be able to redirect to the home page of DsAlgo after Signin\r\n\r\n","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/SahanaNUMPYNINJASDET\/gitsss\/DsAlgoQuesters\/src\/test\/resources\/dsAlgoFeatures\/Register.feature","feature":{"location":{"line":2,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Register functionality","description":"","children":[{"scenario":{"location":{"line":5,"column":3},"tags":[{"location":{"line":4,"column":3},"name":"@Register1","id":"285dd328-af3e-4ced-8872-2039f34dfa8d"}],"keyword":"Scenario","name":"Verify the user is able to land on Register Page","description":"","steps":[{"location":{"line":6,"column":5},"keyword":"Given ","keywordType":"Context","text":"The User is On The Home Page","id":"a6f1bbb0-a159-4b94-85a6-c53c88fdf9d5"},{"location":{"line":7,"column":5},"keyword":"When ","keywordType":"Action","text":"User clicks Register link on the Home page","id":"c3a9f745-670d-40e4-9f1a-4ce4945558c3"},{"location":{"line":8,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"The user should be redirected to Register form","id":"e77ec6aa-6fac-477a-bfd0-9d07214afdc1"}],"examples":[],"id":"1f641b4f-7372-4383-be23-3ae2d7aad778"}},{"scenario":{"location":{"line":11,"column":3},"tags":[{"location":{"line":10,"column":3},"name":"@Register2","id":"756216c1-9e90-4a8d-800d-7465da51249f"}],"keyword":"Scenario Outline","name":"Verify that user gets error message giving username without entering password and password confirmation when clicking on","description":"    register button","steps":[{"location":{"line":14,"column":5},"keyword":"Given ","keywordType":"Context","text":"The user is on the register page","id":"f02b7b61-221d-49bc-b4b2-747947d9bc11"},{"location":{"line":15,"column":5},"keyword":"When ","keywordType":"Action","text":"The use ame":"@Register10","astNodeId":"05648ece-853e-4f33-8fb5-56fdc643bef7"}],"astNodeIds":["55e8194a-191e-45bb-9ead-f09d6dd563d6"]}},{"source":{"uri":"file:\/\/\/C:\/SahanaNUMPYNINJASDET\/gitsss\/DsAlgoQuesters\/src\/test\/resources\/dsAlgoFeatures\/Signin.feature","data":"Feature: Signin functionality\r\n\r\n  @signin1\r\n  Scenario: Verify the user is direct to Login Page\r\n    Given The User is On the Home Page\r\n    When User clicks on Sign in link\r\n    Then The user should be directed to Signin page\r\n\r\n  @signin2\r\n  Scenario Outline: Verify the user is able to login  giving valid username and valid password when clicking on login button\r\n    Given The user is on the Login Page\r\n    When User enters valid username and valid password and clicks Login button \"<Sheetname>\" and row <RowNumber>\r\n    Then The user is directed to Data Structure home page with message \"You are logged in\"\r\n\r\n    Examples: \r\n      | Sheetname | RowNumber |\r\n      | Signin    |         1 |\r\n\r\n  @signin3\r\n  Scenario Outline: Verify the user should not able to login  giving Invalid username and valid password when clicking on login button\r\n    Given The user is on the Login Page\r\n    When User enters Invalid username and valid password and clicks Login button \"<Sheetname>\" and row <RowNumber>\r\n    Then The user should get a warning message \"Invalid Username and Password\"\r\n\r\n    Examples: \r\n      | Sheetname | RowNumber |\r\n      | Signin    |         2 |\r\n\r\n  @signin4\r\n  Scenario Outline: Verify the user should not able to login  giving valid username and Invalid password when clicking on login button\r\n    Given The user is on the Login Page\r\n    When User enters valid username and Invalid password and clicks Login button \"<Sheetname>\" and row <RowNumber>\r\n    Then The user should get a warning message \"Invalid Username and Password\"\r\n\r\n    Examples: \r\n      | Sheetname | RowNumber |\r\n      | Signin    |         3 |\r\n\r\n  @signin5\r\n  Scenario Outline: Verify the user should not able to login  giving Invalid username and Invalid password when clicking on login button\r\n    Given The user is on the Login Page\r\n    When User enters Invalid username and Invalid password and clicks Login button \"<Sheetname>\" and row <RowNumber>\r\n    Then The user should get a warning message \"Invalid Username and Password\"\r\n\r\n    Examples: \r\n      | Sheetname | RowNumber |\r\n      | Signin    |         4 |\r\n\r\n  @signin6\r\n  Scenario: Verify the user should not able to login  giving empty username and empty password when clicking on login button\r\n    Given The user is on the Login Page\r\n    When User clicks Login button without  entering username and password\r\n    Then The user should get a element showing empty field \"Please fill out this field.\"\r\n\r\n  @signin7\r\n  Scenario Outline: Verify the user gets error message without entering username and giving Password when clicking on login button\r\n    Given The user is on the Login Page\r\n    When User clicks on Login link on Login page without entering username and giving password from sheetname \"<Sheetname>\" and row <RowNumber>\r\n    Then The user should get a element showing empty field \"Please fill out this field.\"\r\n\r\n    Examples: \r\n      | Sheetname | RowNumber |\r\n      | Signin    |         5 |\r\n\r\n  @signin8\r\n  Scenario Outline: Verify the user gets error message entering username and without entering Password when clicking on login button\r\n    Given The user is on the Login Page\r\n    When User clicks on Login link on Login page entering username and without entering password from sheetname \"<Sheetname>\" and row <RowNumber>\r\n    Then The user should get a element showing empty field \"Please fill out this field.\"\r\n\r\n    Examples: \r\n      | Sheetname | RowNumber |\r\n      | Signin    |         6 |\r\n\r\n  @signin9\r\n  Scenario: Verify the user is able to sign out successfully\r 4-85d4-57d49db35024","type":"Context","text":"The user is On the Home Page"},{"astNodeIds":["80dcbc8e-f020-4ef2-b6ff-da38d04edff9"],"id":"8fb8ea98-b248-441c-a4c5-a332d24f895f","type":"Action","text":"User clicks Signout link"},{"astNodeIds":["f352b817-bbd4-4b67-a2b1-a78096980b85"],"id":"a8c79338-53a5-406c-8972-3f063c6a9652","type":"Outcome","text":"The user should be redirected to home page with message \"Logged out successfully\""}],"tags":[{"name":"@signin9","astNodeId":"bc75615a-39ea-4c39-9e0a-9740e94efbf9"}],"astNodeIds":["e37a7921-b74c-4905-bdd6-faef61d63dce"]}},{"source":{"uri":"file:\/\/\/C:\/SahanaNUMPYNINJASDET\/gitsss\/DsAlgoQuesters\/src\/test\/resources\/dsAlgoFeatures\/Stack.feature","data":"Feature: Stack functionality\r\n\r\nBackground:\r\nGiven The user is on the DSAlgo homepage after sign\r\n\r\n@stack1\r\nScenario: Verify that the user can navigate to the Stack page after signin\r\n    \r\n    When the user clicks on the GetStarted button of Stack section\r\n    Then the user is navigated to the Stack page\r\n    \r\n@stack2\r\nScenario Outline: Verify the user is able to navigate to the Operations in Stack in Stack page\r\n    Given the user is on the Stack page\r\n    When the user clicks on the Options \"<Sheetname>\" and <RowNumber> in Stack Page\r\n    Then the user should navigated to the Options \"<Sheetname>\" and <RowNumber> in Stack page\r\n    \r\n    Examples:\r\n    | Sheetname    | RowNumber |\r\n    | Stack        |   1       |              \r\n    | Stack        |   2       | \r\n    | Stack        |   3       |\r\n    \r\n  \r\n@stack3  \r\nScenario Outline: Verify that user is able to navigate to the try Editor page from different options in Stack Page\r\n    Given The user is on the Stack Options \"<Sheetname>\" and <RowNumber> page\r\n    When The user clicks on the Try here button on the Stack Options page\r\n    Then The user should navigate to the tryeditor page \r\n    \r\n    Examples:\r\n    | Sheetname    | RowNumber |\r\n    | Stack        |   1       |              \r\n    | Stack        |   2       | \r\n    | Stack        |   3       |\r\n \r\n @Regression\r\nScenario Outline: Verify that user is able to run valid Python code in Try Editor for Stack Page\r\n  Given The user is on the tryeditor page of Operations in Stack\r\n  When The user enters code \"<code>\", \"<Sheetname>\" and <RowNumber> clicks the Run button\r\n  Then The user should see an result \"<expectedresult>\", \"<Sheetname>\" and <RowNumber>\r\n  Examples:\r\n    | Sheetname    | RowNumber |code     |expectedresult      |\r\n    | tryEditor    |  1        | Valid   |  successouput      |           \r\n    | tryEditor    |  2       | Invalid |alertmessageoutput  |\r\n\r\n    \r\n @Regression\r\nScenario Outline: Verify that user is able to run valid Python code in Try Editor for Stack Page\r\n   Given The user is on the tryeditor page of Implementation\r\n   When The user enters code \"<code>\", \"<Sheetname>\" and <RowNumber> clicks the Run button\r\n   Then The user should see an result \"<expectedresult>\", \"<Sheetname>\" and <RowNumber>\r\n  Examples:\r\n    | Sheetname    | RowNumber |code     |expectedresult      |\r\n    | tryEditor    |  1        | Valid   |  successouput      |           \r\n    | tryEditor    |  2        | Invalid |alertmessageoutput  |\r\n\r\n    \r\n @Regression\r\nScenario Outline: Verify that user is able to run valid Python code in Try Editor for Stack Page\r\n   Given The user is on the tryeditor page of Applications\r\n   When The user enters code \"<code>\", \"<Sheetname>\" and <RowNumber> clicks the Run button\r\n   Then The user should see an result \"<expectedresult>\", \"<Sheetname>\" and <RowNumber>\r\n  Examples:\r\n    | Sheetname    | RowNumber |code     |expectedresult      |\r\n    | tryEditor    |  1        | Valid   |  successouput      |           \r\n    | tryEditor    |  2        | Invalid |alertmessageoutput  |\r\n   \r\n    \r\n@stack7  \r\nScenario Outline: Verify the user is able to navigate to the Practice Questions mentioned under three options pages\r\n      Given The user is navigates to three Options \"<Sheetname>\" and <RowNumber> of stack page \r\n      When the user clicks on the Practice Questions link \r\n      Then the user should navigated to the Practice Questions page of three options \"<Sheetname>\" and <RowNumber> in Stack page \r\n       \r\n    Examples:\r\n    | Sheetname    | RowNumber |\r\n    | Stack        |   1       |              \r\n    | Stack        |   2       | \r\n    | Stack        |   3       |\r\n      \r\n@stack8\r\nScenario Outline: Verify the user see list of Practice Questions in Practice Questions Page of three options pages \r\n    Given The user is navigates to three Options \"<Sheetname>\" and <RowNumber> of stack page \r\n    When the user clicks on the Practice Questions link \r\n    Then the user should see list of Practice Questions in Practice Questions Page   \r\n     Examples:\r\n    | Sheetname    | RowNumber |\r\n    | Stack        |   1       |              \r\n    | Stack        |   2       | \r\n    | Stack        |   3       |\r\n    \r\n\r\n@stack9\r\nScenario Outline: Verify that user receives error when user clicks on run button without entering code in tryeditor for Stack Page\r\n    Given The user is on the tryeditor page of three Options \"<Sheetname>\" and <RowNumber> of stack page\r\n    When the user clicks the Run button\r\n    Then the user should see an error message\r\n     Examples:\r\n    | Sheetname    | RowNumber |\r\n    | Stack        |   1       |              \r\n    | Stack        |   2       | \r\n    | Stack        |   3       |","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/SahanaNUMPYNINJASDET\/gitsss\/DsAlgoQuesters\/src\/test\/resources\/dsAlgoFeatures\/Stack.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Stack functionality","descripti ge\n    When The user clicks the Getting Started button in Tree Panel\n    Then The user be directed to Tree DataStructure Page\n\n  @Tree02\n  Scenario Outline: Verify the user is able to navigate to the Operations in Tree in Tree page\n    Given User is on Tree Page\n    When User click on Options \"<SheetName>\" and <RowNumber> in Tree page\n    Then User should redirected to Options \"<SheetName>\" and <RowNumber> in Tree page\n\n    Examples: \n      | SheetName | RowNumber |\n      | Tree      |         1 |\n      | Tree      |         2 |\n      | Tree      |         3 |\n      | Tree      |         4 |\n      | Tree      |         5 |\n      | Tree      |         6 |\n      | Tree      |         7 |\n      | Tree      |         8 |\n      | Tree      |         9 |\n      | Tree      |        10 |\n      | Tree      |        11 |\n      | Tree      |        12 |\n      | Tree      |        13 |\n\n  @Tree03\n  Scenario Outline: Verify the user is able to navigate to TryEditor page from Tree Options\n    Given The user is on the Tree Options \"<SheetName>\" and <RowNumber> page\n    When The user click Try Here button on Tree Options page\n    Then The user should redirected to Try Editor of each Options\n\n    Examples: \n      | SheetName | RowNumber |\n      | Tree      |         1 |\n      | Tree      |         2 |\n      | Tree      |         3 |\n      | Tree      |         4 |\n      | Tree      |         5 |\n      | Tree      |         6 |\n      | Tree      |         7 |\n      | Tree      |         8 |\n      | Tree      |         9 |\n      | Tree      |        10 |\n      | Tree      |        11 |\n      | Tree      |        12 |\n      | Tree      |        13 |\n\n  @Regression\n  Scenario Outline: Verify that valid and invalid python code in TryEditor Overview of Trees\n    Given The user is in TryEditor page of Overview of Trees\n    When The user enters code from \"<code>\",\"<Sheetname>\" and <RowNumber> clicks the Run button\n    Then The user should see a result \"<expectedresult>\",\"<Sheetname>\" and <RowNumber>\n\n    Examples: \n      | Sheetname | RowNumber | code    | expectedresult     |\n      | tryEditor |         1 | Valid   | successouput       |\n      | tryEditor |         2 | Invalid | alertmessageoutput |\n\n  @Regression\n  Scenario Outline: Verify that valid and invalid python code in TryEditor Terminologies\n    Given The user is in TryEditor page of Terminologies\n    When The user enters code from \"<code>\",\"<Sheetname>\" and <RowNumber> clicks the Run button\n    Then The user should see a result \"<expectedresult>\",\"<Sheetname>\" and <RowNumber>\n\n    Examples: \n      | Sheetname | RowNumber | code    | expectedresult     |\n      | tryEditor |         1 | Valid   | successouput       |\n      | tryEditor |         2 | Invalid | alertmessageoutput |\n\n  @Regression\n  Scenario Outline: Verify that valid and invalid python code in TryEditor Types of Trees\n    Given The user is in TryEditor page of TypesOfTrees\n    When The user enters code from \"<code>\",\"<Sheetname>\" and <RowNumber> clicks the Run button\n    Then The user should see a result \"<expectedresult>\",\"<Sheetname>\" and <RowNumber>\n\n    Examples: \n      | Sheetname | RowNumber | code    | expectedresult     |\n      | tryEditor |         1 | Valid   | successouput       |\n      | tryEditor |         2 | Invalid | alertmessageoutput |\n\n  @Regression\n  Scenario Outline: Verify that valid and invalid python code in TryEditor Tree Traversals\n    Given The user is in TryEditor page of TreeTraversals\n    When The user enters code from \"<code>\",\"<Sheetname>\" and <RowNumber> clicks the Run button\n    Then The user should see a result \"<expectedresult>\",\"<Sheetname>\" and <RowNumber>\n\n    Examples: \n      | Sheetname | RowNumber | code    | expectedresult     |\n      | tryEditor |         1 | Valid   | successouput       |\n      | tryEditor |         2 | Invalid | alertmessageoutput |\n\n   @
